db.patients.aggregate([    {        $unwind: "$ENCOUNTERS"    },    {        $unwind: "$ENCOUNTERS.MEDICATIONS"    },    {        $match: {            "ENCOUNTERS.MEDICATIONS.DESCRIPTION": "Simvastatin 10 MG Oral Tablet"        }    },    {        $group: {            _id: {                medication: "$ENCOUNTERS.MEDICATIONS.DESCRIPTION"            },            success_rate: {                $sum: {                    $cond: [                        { $gte: [ "$ENCOUNTERS.MEDICATIONS.REASON_CODE", 1 ] }, 1, 0 ]                    }
                }
            }    },    {        $project: {            _id: 0,            medication: "$_id.medication",            success_rate: { $divide: [ "$success_rate", { $size: "$$ROOT" } ] }        }    }]);

db.patients.aggregate([
    {
        $unwind: "$CLAIMS"
    },
    {
        $unwind: "$CLAIMS.CLAIM_TRANSACTIONS"
    },
    {
        $lookup: {
            from: "payers",
            localField: "CLAIMS.PRIMARY_PATIENT_INSURANCE_REF",
            foreignField: "PAYER_ID",
            as: "payer"
        }
    },
    {
        $unwind: "$payer"
    },
    {
        $match: {
            "payer.NAME": "Humana"
        }
    },
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $unwind: "$ENCOUNTERS.MEDICATIONS"
    },
    {
        $match: {
            "ENCOUNTERS.MEDICATIONS.PAYER_COVERAGE": {
                $eq: 0
            }
        }
    },
    {
        $group: {
            _id: null,
            count: {
                $sum: 1
            }
        }
    },
    {
        $project: {
            _id: 0,
            count: 1
        }
    }
])

db.patients.aggregate([
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $unwind: "$ENCOUNTERS.MEDICATIONS"
    },
    {
        $lookup: {
            from: "payers",
            localField: "ENCOUNTERS.MEDICATIONS.PAYER_REF",
            foreignField: "PAYER_ID",
            as: "payer"
        }
    },
    {
        $unwind: "$payer"
    },
    {
        $match: {
            "payer.NAME": "NO_INSURANCE",
            "ENCOUNTERS.MEDICATIONS.PAYER_COVERAGE": {
                $eq: 0
            }
        }
    },
    {
        $group: {
            _id: null,
            count: {
                $sum: 1
            }
        }
    },
    {
        $project: {
            _id: 0,
            count: 1
        }
    }
])

db.patients.aggregate([
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $unwind: "$ENCOUNTERS.IMAGING_STUDIES"
    },
    {
        $lookup: {
            from: "payers",
            localField: "ENCOUNTERS.IMAGING_STUDIES.PROCEDURE_CODE",
            foreignField: "HEALTHCARE_CLAIM_TYPE_ID_1",
            as: "payer_info"
        }
    },
    {
        $unwind: "$payer_info"
    },
    {
        $match: {
            "payer_info.NAME": "Anthem",
            "ENCOUNTERS.IMAGING_STUDIES.REASON_CODE": {
                $exists: true
            },
            "ENCOUNTERS.IMAGING_STUDIES.REASON_CODE": {
                $ne: null
            },
            "ENCOUNTERS.IMAGING_STUDIES.REASON_DESCRIPTION": {
                $eq: "uncovered"
            }
        }
    },
    {
        $group: {
            _id: null,
            count: {
                $sum: 1
            }
        }
    },
    {
        $project: {
            _id: 0,
            count: 1
        }
    }
])

db.patients.aggregate([    {        $lookup: {            from: "payers",            localField: "CLAIMS.PRIMARY_PATIENT_INSURANCE_REF",
            foreignField: "PAYER_ID",
            as: "payer\_info"
        }
    },
    {
        $unwind: "$payer\_info"
    },
    {
        $match: {
            "payer\_info.PAYER\_ID": "b046940f-1664-3047-bca7-dfa76be352a4"
        }
    },
    {
        $project: {
            _id: 0,
            PATIENT\_ID: "$PATIENT\_ID",
            FIRST: "$FIRST",
            LAST: "$LAST"
        }
    }
]);

db.patients.aggregate([
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $unwind: "$ENCOUNTERS.PROCEDURES"
    },
    {
        $match: {
            "ENCOUNTERS.ALLERGIES.DESCRIPTION": "Mold (organism)"
        }
    },
    {
        $group: {
            _id: {
                procedure_code: "$ENCOUNTERS.PROCEDURES.CODE",
                procedure_description: "$ENCOUNTERS.PROCEDURES.DESCRIPTION"
            },
            count: { $sum: 1 }
        }
    },
    {
        $sort: {
            count: -1
        }
    },
    {
        $limit: 1
    },
    {
        $project: {
            _id: 0,
            procedure_code: "$_id.procedure_code",
            procedure_description: "$_id.procedure_description"
        }
    }
])
